import React, { useEffect, useState } from 'react';
import {
  Box, Typography, Paper, Table, TableHead, TableRow, TableCell, TableBody,
  TextField, Button, IconButton
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import EditIcon from '@mui/icons-material/Edit';
import api from '../services/api';

export default function MasterToko() {
  const [tokoData, setTokoData] = useState([]);
  const [nama, setNama] = useState('');
  const [modalAwal, setModalAwal] = useState('');
  const [editingId, setEditingId] = useState(null);

  const fetchToko = async ()=>{
    try {
      const res = await api.get('/finance/toko');
      setTokoData(res.data);
    } catch(e){
      alert('Gagal memuat data Toko');
    }
  };

  useEffect(()=>{
    fetchToko();
  },[]);

  const handleSubmit = async(e)=>{
    e.preventDefault();
    try {
      if(editingId){
        // Update
        await api.put(`/finance/toko/${editingId}`, { nama, modalAwal });
      } else {
        // Create
        await api.post('/finance/toko', { nama, modalAwal });
      }
      setNama('');
      setModalAwal('');
      setEditingId(null);
      fetchToko();
    } catch(err){
      alert('Error submit');
    }
  };

  const handleEdit = (t)=>{
    setEditingId(t.id);
    setNama(t.nama);
    setModalAwal(t.modalAwal);
  };

  const handleDelete = async(id)=>{
    if(!window.confirm('Hapus data Toko ini?')) return;
    try {
      await api.delete(`/finance/toko/${id}`);
      fetchToko();
    } catch(err){
      alert('Gagal hapus Toko');
    }
  };

  return (
    <Box>
      <Typography variant="h5" sx={{ fontWeight:700, mb:2 }}>Master Toko</Typography>

      <Paper sx={{ p:2, mb:3 }}>
        <Typography variant="h6">{ editingId ? 'Edit Toko' : 'Tambah Toko'}</Typography>
        <form onSubmit={handleSubmit}>
          <TextField
            label="Nama Toko"
            value={nama}
            onChange={(e)=>setNama(e.target.value)}
            fullWidth
            margin="normal"
          />
          <TextField
            label="Modal Awal"
            type="number"
            value={modalAwal}
            onChange={(e)=>setModalAwal(e.target.value)}
            fullWidth
            margin="normal"
          />
          <Button type="submit" variant="contained" sx={{ mt:2 }}>
            { editingId ? 'Update' : 'Simpan' }
          </Button>
        </form>
      </Paper>

      <Paper sx={{ p:2 }}>
        <Table>
          <TableHead>
            <TableRow sx={{ backgroundColor:'#f5f5f5' }}>
              <TableCell>ID</TableCell>
              <TableCell>Nama</TableCell>
              <TableCell>Modal Awal</TableCell>
              <TableCell>Aksi</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {tokoData.map((t)=>(
              <TableRow key={t.id}>
                <TableCell>{t.id}</TableCell>
                <TableCell>{t.nama}</TableCell>
                <TableCell>{t.modalAwal}</TableCell>
                <TableCell>
                  <IconButton onClick={()=>handleEdit(t)}>
                    <EditIcon />
                  </IconButton>
                  <IconButton onClick={()=>handleDelete(t.id)}>
                    <DeleteIcon color="error"/>
                  </IconButton>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Paper>
    </Box>
  );
}
